#include <iostream>using namespace std;int main() {	int N;	cin >> N;	int *arr = new int[N];	for (int i = 0; i < N; i++) cin >> arr[i];		int min,temp;	for (int i = 0; i < N-1; i++) {		min = i;		for (int j = i + 1; j < N; j++) {			if (arr[min] > arr[j]) min = j;		}		temp = arr[i];		arr[i] = arr[min];		arr[min] = temp;	}	for (int i = 0; i < N; i++) {		cout << arr[i] << endl;	}}